export const Home = () => {
    const [counter, setCounter] = useState(0);
    console.log(counter);

    return (
        <>
        <div style={{display: "flex", height: "100vh", alignItems:"center", justifyContent:"center"}}>
            <div>
                <p>COUNT: {counter}</p>
                <button
                    onClick={() => {
                        setCounter(counter + 1);
                    }}
                >
                    <p>Add Counter</p>
                </button>
            </div>
        </div>
        </>


    );

};
